import {makeStyles} from '@material-ui/core/styles'

const styles = makeStyles((theme) =>({
    navBar:{
        backgroundColor:'#21253c',
    },
    navBarBtn:{
        fontSize:17,
        color: '#fe4661',
        '&:hover':{
            opacity: 0.7,
        }
    },
    toolBer:{
        justifyContent:'space-between',
    },
    homeLink:{
        '&:hover': {
            color: '#fe4661',
            cursor:'pointer',
        }
    },
}))

export default styles;
